import React from "react";
import "./Card.css";

export default function Card({data}) {
  return (
    <>
      <div className="Parent">
        <img src={`imgs/${data.image}`} alt={data.name} />

        <h1>Nam{data.name}</h1>
        <h4>Age-{data.age}</h4>

        <p>{data.Description}</p>
        


      </div>
    </>
  );
}
